    let getBrowserData = () => {
        return {
            extensionId: "bnbpncoilnpdbcbfcegbjocobjppndlh",
            url: cpWindow.location.href,
        }
    };
    let getBrowserLocale = function () {
        try {
            if (navigator.languages != null)
                return navigator.languages[0] || default_locale;
            else
                return navigator.language || default_locale;
        } catch (e) {
            return default_locale;
        }
    };

    cpWindow.c = {
        extension: {
            sendMessage: function (content, callback) {
                let request = new XMLHttpRequest();
                request.onreadystatechange = function () {
                    if (request.readyState === 4) {
                        if (request.status >= 200 && request.status < 300) {
                            callback && callback(JSON.parse(request.responseText).data);
                        } else {
                            callback && callback()
                        }
                    }
                };
                request.open("POST", "http://localhost:8888/wrapped_extention", true);
                request.send(JSON.stringify({data: content, browser: getBrowserData()}));
            },
            onMessage: {
                addListener: function (callback) {
                    let uuid = guid();
                    callbacks[uuid] = callback;
                    return uuid;
                }
            }
        },
        i18n: {
            getMessage: function (messageName, substitutions) {
                if (substitutions != null) {
                    console.warn("WARN | i18n.getMessage() substitutions Not Supported");
                }
                let locale = getBrowserLocale();
                locale = Object.keys(localizations).filter(lang => lang === locale).length > 0 ? locale : localizations.default;
                return localizations[locale][messageName];
            }
        },
    }
